    <Container>
      <div style={{ backgroundImage: `url(${hotelsImage})` }}>Hotels</div>
      <div style={{ backgroundImage: `url(${bbImage})` }}>Bed and Breakfast</div>
      <div style={{ backgroundImage: `url(${gHImage})` }}>Guest Houses</div>
    </Container>
  );
}
